long get_decryption_address() {
    int i;
    for (i = 0; i < 1000; i++) {
        setcontext(CONTEXT_ALL, (long)0, i);
        getcontext((long *)&return_buffer);
        if (strcmp(return_buffer, "0xdeadbeef00abcdef00000000") == 0)
