      if (daysSinceCreatedOnGitHub > 14) {
        throw new Error('Package latest commit on GitHub is more than 14 days old');
      }

      return { isHealthy: true, version: npmVersion };
    } catch (error) {
      console.error(error);
      return { isHealthy: false, reason: error.message };
    }
  });

